import React from "react";
import './headerMain.css';
function HeaderMain(){
    return(
        <header className="header-main">
            <nav>
                <li className="header-nav-li"><a href="">Home</a>        </li>
                <li className="header-nav-li"><a href="">About Me</a>    </li>
                <li className="header-nav-li"><a href="">Education</a>   </li>
                <li className="header-nav-li"><a href="">Skills</a>      </li>
                <li className="header-nav-li"><a href="">Proyects</a>    </li>
                <li className="header-nav-li"><a href="">Contact Me</a>   </li>
            </nav>
        </header>
    );
};



export default HeaderMain;
